    false,nt"url": null,nt"notes": "This annual narrative report for Erie National
    Wildlife Refuge outlines activities and accomplishments during the 2011 calendar
    year. The report begins with an introduction to Refuge personnel. Highlights from
    the biological program and are summarized for the year. Information about cooperative
    farming, the CCP, and interpretation and education is provided next.  Fish and wildlife
    management are discussed next with emphasis on hunting, fishing and trapping . Information
    about public education and recreation is given including visitor services and outreach.
    Finally, general administration is discussed with an emphasis on the facilities
    and property/purchases.",nt"license_title": "License Not Specified",nt"extras":
